window.bookSummaryJSON = "<p>Death is not the end.</p> <p>But the hells might just end Evelyn's story. They're a strange, dangerous place, and as it turns out, the hells have connections to the Titans...and the system itself.</p> <p>Sapphire wants something out of them. The worlds are falling apart at the seams.</p> <p>In the madness, all Evelyn knows is a handful of truths.</p> <p>She will advance. She will survive. She will kill.</p> <p>And she will DEVOUR.</p> <p>Experience the thrilling conclusion to Demonic Devourer in the third book of a bloody, action-packed LitRPG series featuring more powerful skills, more broken systems, and a protagonist who refuses to lose!</p>"; 
